-- [id] = title, minlevel, groupsize, desc
Attune_Data.quests = {
	[7848] = {"Attunement to the Core", 55, 5, "Venture to the Molten Core entry portal in Blackrock Depths and recover a Core Fragment. Return to Lothos Riftwaker in Blackrock Mountain when you have recovered the Core Fragment."},
	[7847] = {"Return to Primal Torntusk", 46, 1, "Elder Torntusk at Jintha'alor wants you to return to Primal Torntusk at Revantusk Village with news of his rescue."},
	[4903] = {"Warlord's Command", 55, 5, "Slay Highlord Omokk, War Master Voone, and Overlord Wyrmthalak. Recover Important Blackrock Documents. Return to Warlord Goretooth in Kargath when the mission has been accomplished."},
	[4941] = {"Eitrigg's Wisdom", 55, 1, "Speak with Eitrigg in Orgrimmar. When you have discussed matters with Eitrigg, seek council from Thrall.\n\nYou recall having seen Eitrigg in Thrall's chamber."},
	[4974] = {"For The Horde!", 55, 10, "Travel to Blackrock Spire and slay Warchief Rend Blackhand. Take his head and return to Orgrimmar."},
	[6566] = {"What the Wind Carries", 55, 1, "Listen to Thrall."},
	[6567] = {"The Champion of the Horde", 55, 1, "Seek out Rexxar. The Warchief has instructed you as to his whereabouts. Search the paths of Desolace, between the Stonetalon Mountains and Feralas."},
	[6568] = {"The Testament of Rexxar", 55, 1, "Deliver Rexxar's Letter to Myranda the Hag in the Western Plaguelands."},
	[6569] = {"Oculus Illusions", 55, 10, "Travel to Blackrock Spire and collect 20 Black Dragonspawn Eyes. Return to Myranda the Hag when the task is complete."},
	[6570] = {"Emberstrife", 55, 1, "Travel to the Wyrmbog in Dustwallow Marsh and seek out Emberstrife's Den. Once inside, wear the Amulet of Draconic Subversion and speak with Emberstrife."},
	[6582] = {"The Test of Skulls, Scryer", 55, 5, "You must find the blue dragonflight drake champion, Scryer, and slay him. Pry his skull from his corpse and return it to Emberstrife. \n\nYou know that Scryer can be found in Winterspring."},
	[6583] = {"The Test of Skulls, Somnus", 55, 5, "Destroy the drake champion of the Green Flight, Somnus. Take his skull and return it to Emberstrife."},
	[6584] = {"The Test of Skulls, Chronalis", 55, 5, "Guarding the Caverns of Time in the Tanaris Desert is Chronalis, child of Nozdormu. Destroy him and return his skull to Emberstrife."},
	[6585] = {"The Test of Skulls, Axtroz", 55, 5, "Travel to Grim Batol and track down Axtroz, drake champion of the Red Flight. Destroy him and take his skull. Return the skull to Emberstrife."},
	[6601] = {"Ascension...", 55, 1, "It would appear as if the charade is over. You know that the Amulet of Draconic Subversion that Myranda the Hag created for you will not function inside Blackrock Spire. Perhaps you should find Rexxar and explain your predicament. Show him the Dull Drakefire Amulet. Hopefully he will know what to do next."},
	[6602] = {"Blood of the Black Dragon Champion", 55, 10, "Travel to Blackrock Spire and slay General Drakkisath. Gather his blood and return it to Rexxar."},
	[4182] = {"Dragonkin Menace", 48, 2, "Slay 15 Black Broodlings, 10 Black Dragonspawn, 4 Black Wyrmkin and 1 Black Drake. Return to Helendis Riverhorn when the task is complete."},
	[4183] = {"The True Masters", 48, 1, "Travel to Lakeshire and deliver Helendis Riverhorn's Letter to Magistrate Solomon."},
	[4184] = {"The True Masters", 48, 1, "Travel to Stormwind and deliver Solomon's Plea to Highlord Bolvar Fordragon.\n\nBolvar resides in Stormwind Keep."},
	[4185] = {"The True Masters", 48, 1, "Speak with Highlord Bolvar Fordragon after speaking with Lady Katrana Prestor."},
	[4186] = {"The True Masters", 48, 1, "Take Bolvar's Decree to Magistrate Solomon in Lakeshire."},
	[4223] = {"The True Masters", 48, 1, "Speak with Marshal Maxwell in the Burning Steppes."},
	[4224] = {"The True Masters", 48, 1, "Speak with Ragged John to learn of Marshal Windsor's fate and return to Marshal Maxwell when you have completed this task.\n\nYou recall Marshal Maxwell telling you to search for him in a cave to the north."},
	[4241] = {"Marshal Windsor", 48, 5, "Travel to Blackrock Mountain in the northwest and enter Blackrock Depths. Find out what became of Marshal Windsor.\n\nYou recall Ragged John talking about Windsor being dragged off to a prison."},
	[4242] = {"Abandoned Hope", 48, 1, "Give Marshal Maxwell the bad news."},
	[4264] = {"A Crumpled Up Note", 50, 1, "You may have just stumbled on to something that Marshal Windsor would be interested in seeing. There may be hope, after all."},
	[4282] = {"A Shred of Hope", 50, 5, "Return Marshal Windsor's Lost Information.\n\nMarshal Windsor believes that the information is being held by Golem Lord Argelmach and General Angerforge."},
	[4322] = {"Jail Break!", 50, 5, "Help Marshal Windsor get his gear back and free his friends. Return to Marshal Maxwell if you succeed."},
	[6402] = {"Stormwind Rendezvous", 50, 1, "Travel to Stormwind City and venture to the city gates. Speak with Squire Rowe so that he may let Marshal Windsor know that you have arrived."},
	[6403] = {"The Great Masquerade", 50, 1, "Follow Reginald Windsor through Stormwind. Protect him from harm!"},
	[6501] = {"The Dragon's Eye", 50, 1, "You must search the world for a being capable of restoring the power to the Fragment of the Dragon's Eye. The only information you possess about such a being is that they exist."},
	[6502] = {"Drakefire Amulet", 50, 10, "You must retrieve the Blood of the Black Dragon Champion from General Drakkisath. Drakkisath can be found in his throne room behind the Halls of Ascension in Blackrock Spire."},
	[7761] = {"Blackhand's Command", 55, 10, "That is one stupid orc. It would appear as if you need to find this brand and gain the Mark of Drakkisath in order to access the Orb of Command.\n\nThe letter indicates that General Drakkisath guards the brand. Perhaps you should investigate."},
	[9122] = {"The Dread Citadel - Naxxramas", 60, 1, "Archmage Angela Dosantos at Light's Hope Chapel in the Eastern Plaguelands wants 2 Arcane Crystals, 1 Nexus Crystal and 30 gold pieces. You must also be Revered with the Argent Dawn."},
	[9121] = {"The Dread Citadel - Naxxramas", 60, 1, "Archmage Angela Dosantos at Light's Hope Chapel in the Eastern Plaguelands wants 5 Arcane Crystals, 2 Nexus Crystals, 1 Righteous Orb and 60 gold pieces. You must also be Honored with the Argent Dawn."},
	[9123] = {"The Dread Citadel - Naxxramas", 60, 1, "Archmage Angela Dosantos at Light's Hope Chapel in the Eastern Plaguelands will grant you Arcane Cloaking at no cost. You must be Exalted with the Argent Dawn."},	


	[8286] = {"What Tomorrow Brings", 60, 1, "Venture to the Caverns of Time in Tanaris and find Anachronos, Brood of Nozdormu."},
	[8288] = {"Only One May Rise", 60, 40, "Return the Head of the Broodlord Lashlayer to Baristolth of the Shifting Sands at Cenarion Hold in Silithus."},
	[8301] = {"The Path of the Righteous", 60, 2, "Collect 200 Silithid Carapace Fragments and return to Baristolth."},
	[8303] = {"Anachronos", 60, 1, "Seek out Anachronos at the Caverns of Time in Tanaris."},
	[8305] = {"Long Forgotten Memories", 60, 1, "Locate the Crystalline Tear in Silithus and gaze into its depths."},
	[8519] = {"A Pawn on the Eternal Board", 60, 1, "Learn all that you can of the past, then speak with Anachronos at the Caverns of Time in Tanaris."},
	[8555] = {"The Charge of the Dragonflights", 60, 1, "Eranikus, Vaelastrasz, and Azuregos... No doubt you know of these dragons, mortal. It is no coincidence, then, that they have played such influential roles as watchers of our world.\n\nUnfortunately (and my own naivety is partially to blame) whether by agents of the Old Gods or betrayal by those that would call them friend, each guardian has fallen to tragedy. The extent of which has fueled my own distrust towards your kind.\n\nSeek them out... And prepare yourself for the worst."},
	[8575] = {"Azuregos's Magical Ledger", 60, 1, "Deliver Azuregos's Magical Ledger to Narain Soothfancy in Tanaris."},
	[8576] = {"Translating the Ledger", 60, 1, "First things first! We need to figure out what Azuregos wrote in this ledger.\n\nYou say that he's told you to make an arcanite buoy and that this is the schematic? Strange that he would write this in Draconic. That old goat knows I can't read this nonsense.\n\nIf this is going to work, I'm going to need my scrying goggles, a five hundred pound chicken and volume II of 'Draconic for Dummies.' Not necessarily in that order."},
	[8577] = {"Stewvul, Ex-B.F.F.", 60, 1, "Narain Soothfancy wants you to find his ex-best friend forever (BFF), Stewvul, and take back the scrying goggles that Stewvul stole from him."},
	[8578] = {"Scrying Goggles? No Problem!", 60, 40, "Find Narain's Scrying Goggles and return them to Narain Soothfancy in Tanaris."},
	[8728] = {"The Good News and The Bad News", 60, 1, "Narain Soothfancy in Tanaris wants you to bring him 20 Arcanite Bars, 10 Elementium Ore, 10 Azerothian Diamonds, and 10 Blue Sapphires."},
	[8729] = {"The Wrath of Neptulon", 60, 25, "Use the Arcanite Buoy at the Swirling Maelstrom at the Bay of Storms in Azshara."},
	[8742] = {"The Might of Kalimdor", 60, 1, "A thousand years has passed and just as it was fated, one stands before me. One who shall lead their people to a new age.\n\nThe Old God trembles. Oh yes, it fears your faith. Shatter the prophecy of C'Thun.\n\nIt knows you come, champion - and with you comes the might of Kalimdor. You have only to let me know when you are prepared and I shall grant you the Scepter of the Shifting Sands."},
	[8743] = {"Bang a Gong!", 60, 1, "The Scarab Gong looms ominously before you. Steel yourself; for once the Scarab Gong is rung, the gates of Ahn'Qiraj will be opened.\n\n	From the slackened maw of the beast can only come chaos and destruction. Defend your people!"},
	[8584] = {"Never Ask Me About My Business", 60, 1, "Narain Soothfancy in Tanaris wants you to speak with Dirge Quickcleave in Gadgetzan."},
	[8585] = {"The Isle of Dread!", 60, 8, "Recover Lakmaeran's Carcass and 20 Chimaerok Tenderloins for Dirge Quickcleave in Tanaris."},
	[8586] = {"Dirge's Kickin' Chimaerok Chops", 60, 1, "Dirge Quickcleave in Gadgetzan wants you to bring him 20 Goblin Rocket Fuel and 20 Deeprock Salt."},
	[8587] = {"Return to Narain", 60, 1, "Deliver the 500 Pound Chicken to Narain Soothfancy in Tanaris."},
	[8597] = {"Draconic for Dummies", 60, 1, "Find Narain Soothfancy's book, buried on an island in the South Seas."},
	[8599] = {"Love Song for Narain", 60, 1, "Take Meridith's Love Letter to Narain Soothfancy in Tanaris."},
	[8598] = {"rAnS0m", 60, 1, "Return the Ransom Letter to Narain Soothfancy in Tanaris."},
	[8606] = {"Decoy!", 60, 1, "Narain Soothfancy in Tanaris wants you to travel to Winterspring and place the Bag of Gold at the drop off point documented by the booknappers."},
	[8620] = {"The Only Prescription", 60, 40, "Recover the 8 lost chapters of Draconic for Dummies and combine them with the Magical Book Binding and return the completed book of Draconic for Dummies: Volume II to Narain Soothfancy in Tanaris."},
	[8733] = {"Eranikus, Tyrant of the Dream", 60, 5, "Travel to the continent of Teldrassil and find Malfurion's agent somewhere outside the walls of Darnassus."},
	[8734] = {"Tyrande and Remulos", 60, 1, "Travel to the Moonglade and speak to Keeper Remulos."},
	[8735] = {"The Nightmare's Corruption", 60, 40, "Travel to the four Emerald Dream portals in Azeroth and collect a Fragment of the Nightmare's Corruption from each. Return to Keeper Remulos in the Moonglade when you have completed this task."},
	[8736] = {"The Nightmare Manifests", 60, 40, "Defend Nighthaven from Eranikus. Do not let Keeper Remulos perish. Do not slay Eranikus. Defend yourself. Await Tyrande."},
	[8741] = {"The Champion Returns", 60, 1, "Take the Green Scepter Shard to Anachronos at the Caverns of Time in Tanaris."},
	[8730] = {"Nefarius's Corruption", 60, 40, "Slay Nefarian and recover the Red Scepter Shard. Return the Red Scepter Shard to Anachronos at the Caverns of Time in Tanaris. You have 5 hours to complete this task."},

	[10755] = {"Entry Into the Citadel", 68, 1, "Bring the Primed Key Mold to Nazgrel at Thrallmar in Hellfire Peninsula."},
	[10756] = {"Grand Master Rohok", 68, 1, "Bring the Primed Key Mold to Rohok in Thrallmar."},
	[10757] = {"Rohok's Request", 68, 1, "Bring 4 Fel Iron Bars, 2 Arcane Dust and 4 Motes of Fire to Rohok at Thrallmar in Hellfire Peninsula."},
	[10758] = {"Hotter than Hell", 68, 3, "Destroy a Fel Reaver in Hellfire Peninsula and plunge the Unfired Key Mold into its remains. Bring the Charred Key Mold to Rohok in Thrallmar."},
	[10754] = {"Entry Into the Citadel", 68, 1, "Bring the Primed Key Mold to Force Commander Danath at Honor Hold in Hellfire Peninsula."},
	[10762] = {"Grand Master Dumphry", 68, 1, "Bring the Primed Key Mold to Dumphry in Honor Hold."},
	[10763] = {"Dumphry's Request", 68, 1, "Bring 4 Fel Iron Bars, 2 Arcane Dust and 4 Motes of Fire to Dumphry at Honor Hold in Hellfire Peninsula."},
	[10764] = {"Hotter than Hell", 68, 3, "Destroy a Fel Reaver in Hellfire Peninsula and plunge the Unfired Key Mold into its remains. Bring the Charred Key Mold to Dumphry in Honor Hold."},
	
	[9824] = {"Arcane Disturbances", 68, 1, "Use the Violet Scrying Crystal near underground sources of water in the Master's Cellar and return to Archmage Alturus outside of Karazhan."},
	[9825] = {"Restless Activity", 68, 1, "Bring 10 Ghostly Essences to Archmage Alturus outside of Karazhan."},
	[9826] = {"Contact from Dalaran", 68, 1, "Bring Alturus's Report to Archmage Cedric in the outskirts of Dalaran."},
	[9829] = {"Khadgar", 68, 1, "Deliver Alturus's Report to Khadgar in Shattrath City in Terokkar Forest."},
	[9831] = {"Entry Into Karazhan", 68, 1, "Khadgar wants you to enter the Shadow Labyrinth at Auchindoun and retrieve the First Key Fragment from an Arcane Container hidden there."},
	[9832] = {"The Second and Third Fragments", 68, 1, "Obtain the Second Key Fragment from an Arcane Container inside Coilfang Reservoir and the Third Key Fragment from an Arcane Container inside Tempest Keep. Return to Khadgar in Shattrath City after you've completed this task."},
	[10266] = {"Request for Assistance", 67, 1, "Seek out and offer your services to Gahruj. He is located at the Midrealm Post inside Eco-Dome Midrealm in the Netherstorm."},
	[10267] = {"Rightful Repossession", 67, 1, "Collect 10 Boxes of Surveying Equipment and return them to Gahruj at the Midrealm Post inside Eco-Dome Midrealm in the Netherstorm."},
	[10268] = {"An Audience with the Prince", 67, 1, "Deliver the Surveying Equipment to the Image of Nexus-Prince Haramad at the Stormspire in the Netherstorm."},
	[10269] = {"Triangulation Point One", 67, 1, "Use the Triangulation Device to point your way toward the first triangulation point. Once you have found it, report the location to Dealer Hazzin at the Protectorate Watchpost on the Manaforge Ultris island in the Netherstorm."},
	[10275] = {"Triangulation Point Two", 67, 1, "Use the Triangulation Device to point your way toward the second triangulation point. Once you have found it, report the location to Wind Trader Tuluman at Tuluman's Landing, just on the other side of the bridge from the Manaforge Ara island in the Netherstorm."},
	[10276] = {"Full Triangle", 67, 1, "Recover the Ata'mal Crystal and deliver it to the Image of Nexus-Prince Haramad at the Stormspire in the Netherstorm."},
	[10280] = {"Special Delivery to Shattrath City", 67, 1, "Deliver the Ata'mal Crystal to A'dal on the Terrace of Light in Shattrath City."},
	[10704] = {"How to Break Into the Arcatraz", 67, 1, "A'dal has tasked you with the recovery of the Top and Bottom Shards of the Arcatraz Key. Return them to him, and he will fashion them into the Key to the Arcatraz for you."},
	[10205] = {"Warp-Raider Nesaad", 67, 1, "Kill Warp-Raider Nesaad and then return to Nether-Stalker Khay'ji at Area 52 in the Netherstorm."},
	[9836] = {"The Master's Touch", 69, 1, "Go into the Caverns of Time and convince Medivh to enable your Restored Apprentice's Key."},
	[9837] = {"Return to Khadgar", 69, 1, "Return to Khadgar in Shattrath City and show him the Master's Key."},

	[9630] = {"Medivh's Journal", 70, 10, "Archmage Alturus at Deadwind Pass wants you go into Karazhan and speak to Wravien."},
	[9638] = {"In Good Hands", 70, 10, "Speak to Gradav at the Guardian's Library in Karazhan."},
	[9639] = {"Kamsis", 70, 10, "Speak to Kamsis at the Guardian's Library in Karazhan."},
	[9640] = {"The Shade of Aran", 70, 10, "Obtain Medivh's Journal and return to Kamsis at the Guardian's Library in Karazhan."},
	[9645] = {"The Master's Terrace", 70, 10, "Go to the Master's Terrace in Karazhan and read Medivh's Journal. Return to Archmage Alturus with Medivh's Journal after completing this task."},
	[9680] = {"Digging Up the Past", 70, 1, "Archmage Alturus wants you to go to the mountains south of Karazhan in Deadwind Pass and retrieve a Charred Bone Fragment."},
	[9631] = {"A Colleague's Aid", 70, 1, "Take the Charred Bone Fragment to Kalynna Lathred at Area 52 in Netherstorm."},
	[9637] = {"Kalynna's Request", 70, 5, "Kalynna Lathred wants you to retrieve the Tome of Dusk from Grand Warlock Nethekurse in the Shattered Halls of Hellfire Citadel and the Book of Forgotten Names from Darkweaver Syth in the Sethekk Halls in Auchindoun."},
	[9644] = {"Nightbane", 70, 10, "Go to the Master's Terrace in Karazhan and use Kalynna's Urn to summon Nightbane. Retrieve the Faint Arcane Essence from Nightbane's corpse and bring it to Archmage Alturus."},
	
	[10279] = {"To The Master's Lair", 66, 1, "Speak to Andormu at the Caverns of Time."},
	[10277] = {"The Caverns of Time", 66, 1, "Andormu at the Caverns of Time has asked that you follow the Custodian of Time around the cavern."},
	[10282] = {"Old Hillsbrad", 66, 5, "Andormu at the Caverns of Time has asked that you venture to Old Hillsbrad and speak with Erozion."},
	[10283] = {"Taretha's Diversion", 66, 5, "Travel to Durnholde Keep and set 5 incendiary charges at the barrels located inside each of the internment lodges using the Pack of Incendiary Bombs given to you by Erozion."},
	[10284] = {"Escape from Durnholde", 66, 5, "When you are ready to proceed, let Thrall know. Follow Thrall out of Durnholde Keep and help him free Taretha and fulfill his destiny."},
	[10285] = {"Return to Andormu", 66, 5, "Return to the child Andormu at the Caverns of Time in the Tanaris desert."},
	[10901] = {"The Cudgel of Kar'desh", 70, 5, "Skar'this the Heretic in the heroic Slave Pens of Coilfang Reservoir wants you to bring him the Earthen Signet and the Blazing Signet."},
	[10900] = {"The Mark of Vashj", 70, 5, ""},
	[10681] = {"The Hand of Gul'dan", 68, 1, "Speak with Earthmender Torlok at the Altar of Damnation in Shadowmoon Valley."},
	[10458] = {"Enraged Spirits of Fire and Earth", 68, 1, "Earthmender Torlok at the Altar of Damnation in Shadowmoon Valley wants you to use the Totem of Spirits to capture 8 Earthen Souls and 8 Fiery Souls."},
	[10480] = {"Enraged Spirits of Water", 68, 1, "Earthmender Torlok at the Altar of Damnation in Shadowmoon Valley wants you to use the Totem of Spirits to capture 5 Watery Souls."},
	[10481] = {"Enraged Spirits of Air", 68, 1, "Earthmender Torlok at the Altar of Damnation in Shadowmoon Valley wants you to use the Totem of Spirits to capture 10 Airy Souls."},
	[10513] = {"Oronok Torn-heart", 68, 1, "Seek out Oronok Torn-heart on the Shattered Shelf - north of Coilskar Cistern."},
	[10514] = {"I Was A Lot Of Things...", 68, 1, "Oronok Torn-heart at Oronok's Farm in Shadowmoon Valley wants you to recover 10 Shadowmoon Tubers from the Shattered Plains."},
	[10515] = {"A Lesson Learned", 68, 1, "Oronok Torn-heart at Oronok's Farm in Shadowmoon Valley wants you to destroy 10 Ravenous Flayer Eggs on the Shattered Plains."},
	[10519] = {"The Cipher of Damnation - Truth and History", 68, 1, "Oronok Torn-heart at Oronok's Farm in Shadowmoon Valley wants you to listen to his story. Speak to Oronok to begin hearing his story."},
	[10521] = {"Grom'tor, Son of Oronok", 68, 1, "Find Grom'tor, Son of Oronok at Coilskar Point in Shadowmoon Valley."},
	[10527] = {"Ar'tor, Son of Oronok", 68, 1, "Find Ar'tor, Son of Oronok at Illidari Point in Shadowmoon Valley."},
	[10546] = {"Borak, Son of Oronok", 68, 1, "Find Borak, Son of Oronok near Eclipse Point in Shadowmoon Valley."},
	[10522] = {"The Cipher of Damnation - Grom'tor's Charge", 68, 1, "Grom'tor, Son of Oronok at Coilskar Point in Shadowmoon Valley wants you to recover the First Fragment of the Cipher of Damnation."},
	[10528] = {"Demonic Crystal Prisons", 68, 1, "Seek out and slay Painmistress Gabrissa at Illidari Point and return to the corpse of Ar'tor, Son of Oronok with the Crystalline Key."},
	[10547] = {"Of Thistleheads and Eggs...", 68, 1, "Borak, Son of Oronok at the bridge north of Eclipse Point wants you to find a Rotten Arakkoa Egg and deliver it to Tobias the Filth Gorger in Shattrath City, located in northwest Terokkar Forest."},
	[10523] = {"The Cipher of Damnation - The First Fragment Recovered", 68, 1, "Take Grom'tor's Lockbox to Oronok Torn-heart at Oronok's Farm in Shadowmoon Valley."},
	[10537] = {"Lohn'goron, Bow of the Torn-heart", 68, 1, "The Spirit of Ar'tor at Illidari Point in Shadowmoon Valley wants you to recover Lohn'goron, Bow of the Torn-heart from the demons of the area."},
	[10550] = {"The Bundle of Bloodthistle", 68, 1, "Take the Bundle of Bloodthistle back to Borak, Son of Oronok at the bridge near Eclipse Point in Shadowmoon Valley."},
	[10540] = {"The Cipher of Damnation - Ar'tor's Charge", 68, 1, "The Spirit of Ar'tor at Illidari Point in Shadowmoon Valley wants you to recover the Second Fragment of the Cipher of Damnation from Veneratus the Many.\n\nCreatures attacked or damaged by the Spirit Hunter will not yield loot or experience."},
	[10570] = {"To Catch A Thistlehead", 68, 1, "Borak, Son of Oronok at the bridge near Eclipse Point in Shadowmoon Valley wants you to recover the Stormrage Missive."},
	[10541] = {"The Cipher of Damnation - The Second Fragment Recovered", 68, 1, "Take Ar'tor's Lockbox to Oronok Torn-heart at Oronok's Farm in Shadowmoon Valley."},
