	[10577] = {"What Illidan Wants, Illidan Gets...", 68, 1, "Borak, Son of Oronok at the bridge near Eclipse Point in Shadowmoon Valley wants you to Deliver Illidan's Message to Grand Commander Ruusk at Eclipse Point."},
	[10578] = {"The Cipher of Damnation - Borak's Charge", 68, 5, "Borak, Son of Oronok at the bridge near Eclipse Point in Shadowmoon Valley wants you to recover the Third Part of the Cipher of Damnation from Ruul the Darkener."},
