	[10884] = {"Trial of the Naaru: Mercy", 70, 5, "A'dal in Shattrath City wants you to recover the Unused Axe of the Executioner from the Shattered Halls of Hellfire Citadel.\n\nThis quest must be completed in Heroic dungeon difficulty."},
	[10885] = {"Trial of the Naaru: Strength", 70, 5, "A'dal in Shattrath City wants you to recover Kalithresh's Trident and Murmur's Essence.\n\nThis quest must be completed in Heroic dungeon difficulty."},
