	[10685] = {"The Ashtongue Corruptors", 68, 1, "Obtain the four medallion fragments from Haalum, Eykenen, Lakaan and Uylaru and return to Arcanist Thelis at the Sanctum of the Stars in Shadowmoon Valley.\n\nPerforming quests for the Scryers will cause your Aldor reputation level to decrease."},
	[10686] = {"The Warden's Cage", 68, 1, "Arcanist Thelis wants you to enter the Warden's Cage, south of the Ruins of Baa'ri and interrogate Sanoru on Akama's whereabouts.\n\nCompleting quests for the Scryers will cause your Aldor reputation to decrease."},
	[10568] = {"Tablets of Baa'ri", 68, 1, "Anchorite Ceyla at the Altar of Sha'tar wants you to collect 12 Baa'ri Tablets from the ground and from Ashtongue Workers at the Ruins of Baa'ri.\n\nCompleting quests with the Aldor will cause your Scryers reputation level to decrease."},
	[10571] = {"Oronu the Elder", 68, 1, "Anchorite Ceyla at the Altar of Sha'tar wants you to obtain the Orders from Akama from Oronu the Elder at the Ruins of Baa'ri.\n\nCompleting quests for the Aldor will cause your Scryers reputation level to decrease."},
